import React from 'react';
import './Item.css'
const Item = (props) => {
    return (
        <div className='item'>
            <img src={props.image} alt="" />

            <div className='item-price'>
                <p>{props.name}</p>
                ${props.price}
            </div>
        </div>
    );
};

export default Item;
